import React from "react"



const Welcome = () => {
  return (
      <form>
        <label value="email" /> 
        <input type="text" /> 
        <label value="username" /> 
        <input type="text" /> 
        <label value="password" /> 
        <input type="text" /> 
        <input type="submit" />
      </form>
  )
}

export default Welcome;
